import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css";
import Login from "./Login"; // Login bileşeni
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Home = () => {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [isRegister, setIsRegister] = useState(false); // Giriş mi Kayıt mı göstereceğiz onu belirleyeceğiz
  const [isLoggedIn, setIsLoggedIn] = useState(false); // Giriş yapılmış mı onu kontrol et

  const handleOpenModal = () => {
    setIsModalOpen(true); // Modalı aç
  };

  const handleCloseModal = () => {
    setIsModalOpen(false); // Modalı kapat
  };

  const toggleMode = (mode) => {
    setIsRegister(mode === "register"); // Eğer kayıt seçildiyse isRegister true olur
  };

  return (
    <div className="container-fluid">
      <div className="row">
        {/* Sol Reklam Alanı */}
        <div className="col-md-2">
          <div className="advertisement">
            <h4>Reklam Alanı 1</h4>
          </div>
        </div>

        {/* Para Birimleri ve Giriş/Kayıt Butonu */}
        <div className="col-md-8">
          <div className="row no-gutters">
            {/* Para birimi kutuları */}
            <div className="col-md-2">
              <div className="currency-box">Para Birimi 1</div>
            </div>
            <div className="col-md-2">
              <div className="currency-box">Para Birimi 2</div>
            </div>
            <div className="col-md-2">
              <div className="currency-box">Para Birimi 3</div>
            </div>
            <div className="col-md-2">
              <div className="currency-box">Para Birimi 4</div>
            </div>
            <div className="col-md-2">
              <div className="currency-box">Para Birimi 5</div>
            </div>
            <div className="col-md-2">
              <button className="register-box" onClick={handleOpenModal}>
                {isLoggedIn ? "Profilim" : "Giriş Yap/Kayıt Ol"}
              </button>
            </div>
          </div>

          {/* Para grafiği */}
          <div className="chart-section">
            <h4>Para Birimi Grafiği</h4>
          </div>
        </div>

        {/* Sağ Reklam Alanı */}
        <div className="col-md-2">
          <div className="advertisement">
            <h4>Reklam Alanı 2</h4>
          </div>
        </div>
      </div>

      {/* Modal */}
      {isModalOpen && (
        <div className="modal-overlay">
          <div className="modal-content">
            <button className="close-button" onClick={handleCloseModal}>
              &times;
            </button>
            {/* Giriş Yap ve Kayıt Ol seçenekleri */}
            <div className="auth-toggle d-flex justify-content-around">
              <button
                className={`auth-button ${!isRegister ? "active" : ""}`}
                onClick={() => toggleMode("login")}
              >
                Giriş Yap
              </button>
              <button
                className={`auth-button ${isRegister ? "active" : ""}`}
                onClick={() => toggleMode("register")}
              >
                Kayıt Ol
              </button>
            </div>
            {/* Login bileşeni */}
            <Login
              isOpen={isModalOpen}
              onRequestClose={handleCloseModal}
              isRegister={isRegister}
              setIsLoggedIn={setIsLoggedIn}
            />
          </div>
        </div>
      )}
    </div>
  );
};

export default Home;
